import React from 'react';
import { Box, Container, Typography, Accordion, AccordionSummary, AccordionDetails, IconButton } from '@mui/material';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';

const faqs = [
  'Where exactly are you located?',
  'How much does it cost to attend?',
  'What skills are required?',
  'How do I sign up?',
  'Do you help me find a job?'
];

const answer = 'Lorem ipsum dolor sit amet consectetur adipisicing elit. Sint odit exercitationem officiis et aut. Ut iste corrupti facere reiciendis fuga? Lorem ipsum dolor sit amet, consectetur adipisicing elit. impedit placeat sint consequuntur culpa nesciunt veritatis temporibus ut Aperiam voluptatum obcaecati impedit, asperiores quam culpa laudantium. Quae voluptate vel, perspiciatis mollitia.';

export const FAQsSection = () => {
  return (
    <Box component="section" id="questions" sx={{ py: 5 }}>
      <Container>
        <Typography variant="h2" align="center" gutterBottom>
          Frequently Asked Questions
        </Typography>
        <Accordion sx={{ mb: 2 }}>
          {faqs.map((question, index) => (
            <Accordion key={index} sx={{ mb: 1 }}>
              <AccordionSummary expandIcon={<ExpandMoreIcon />} aria-controls={`panel${index}-content`} id={`panel${index}-header`}>
                <Typography variant="h6">{question}</Typography>
              </AccordionSummary>
              <AccordionDetails>
                <Typography>{answer}</Typography>
              </AccordionDetails>
            </Accordion>
          ))}
        </Accordion>
      </Container>
    </Box>
  );
};
